import React from 'react';
import { StyleSheet, Text, View, Button, TextInput } from "react-native";

class Home extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            firstName: '',
            lastName: '',
            email: '',
            phone: ''
        }
    }

    render() {
        return (
            <View
                style={{
                    backgroundColor: "#555",
                    padding: 50,
                    height: "100%",
                    paddingTop: "45%"
                }}
            >
                <Text style={{ textAlign: "right", fontSize: 28, color: "#0fa" }}>
                    ENTER THE
              </Text>
                <Text style={{ textAlign: "right", fontSize: 28, color: "#FFFFFF" }}>
                    DETAILS
              </Text>
                <View
                    style={{
                        flexDirection: "row"
                        // justifyContent: "space-between",
                        // alignItems: "center"
                    }}
                >
                    <TextInput
                        placeholder="FirstName "
                        placeholderTextColor="#C0C0C0"
                        style={{
                            backgroundColor: "#555",
                            width: "100%",
                            borderBottomColor: "black",
                            borderBottomWidth: 1,
                            padding: 20,
                            color: "#C0C0C0"
                        }}
                        onChangeText={(text) => this.setState({ firstName: text })}
                        value={this.state.firstName}
                    />
                </View>
                <View
                    style={{
                        flexDirection: "row"
                        // justifyContent: "space-between",
                        // alignItems: "center"
                    }}
                >
                    <TextInput
                        placeholder="LastName"
                        placeholderTextColor="#C0C0C0"
                        style={{
                            width: "100%",
                            borderBottomColor: "black",
                            borderBottomWidth: 1,
                            padding: 20
                        }}
                        onChangeText={(text) => this.setState({ lastName: text })}
                        value={this.state.lastName}
                    />
                </View>
                <View
                    style={{
                        flexDirection: "row"
                        // justifyContent: "space-between",
                        // alignItems: "flex-start"
                    }}
                >
                    <TextInput
                        placeholder="Email"
                        placeholderTextColor="#C0C0C0"
                        style={{
                            width: "100%",
                            borderBottomColor: "black",
                            borderBottomWidth: 1,
                            padding: 20
                        }}
                        onChangeText={(text) => this.setState({ email: text })}
                        value={this.state.email}
                    />
                </View>
                <View
                    style={{
                        flexDirection: "row"
                        // justifyContent: "space-between",
                        // alignItems: "center"
                    }}
                >
                    <TextInput
                        placeholder="Phone"
                        placeholderTextColor="#C0C0C0"
                        style={{
                            width: "100%",
                            borderBottomColor: "black",
                            borderBottomWidth: 1,
                            padding: 20
                        }}
                        onChangeText={(text) => this.setState({ phone: text })}
                        value={this.state.phone}
                    />
                </View>
                <View
                    style={{
                        flexDirection: "row",
                        justifyContent: "space-between",
                        alignItems: "center",
                        marginTop:"10%"
                    }}
                >
                    <Button

                        color="#0fa"
                        title="Next"
                        style={{
                            borderBottomColor: "black",
                            backgroundColor: "#0fa",
                            color: "#0fa",
                            
                        }}
                        onPress={() => this.props.navigation.navigate('End')}
                    />
                    <Button
                        color="#0fa"
                        title="Clear"
                        style={{
                            borderBottomColor: "black",
                            borderBottomWidth: 2,
                        }}
                    />
                </View>
            </View>
        );
    }
}

const styles = StyleSheet.create({
    background: {
        flex: 1
    }
});

export default Home;
